import ReactDOM from 'react-dom';
import './App.css';
import React, { useState } from 'react';

function App() {
  let [count, setCount] = useState(29);
    return (
      <div>
      <div id="con"><h1 id="h"> My Age is <span id = "ap2">{count}</span></h1></div>
      <div id="bt">
      <button id = "btn1" onClick = {()=>{setCount(count++)}}> ++ </button>
      <button id = "btn2" onClick = {()=>{setCount(count--)}}> -- </button>
      </div>
      </div>
    );
}

export default App;
